static boolean isObjectLitKey(Node node, Node parent) {
    switch (node.getType()) {
      case Token.STRING:
        return parent.isObjectLit();
      case Token.GETTER_DEF:
      case Token.SETTER_DEF:
        return true;
    }
    return false;
  }

